import styled from 'styled-components'


const Title = styled.h2`
color: #fff;
font-weight: 300;
`

const Date = styled.div`
color: red;
font-weight: 300;
margin: 6px 0;
`

const Description = styled.p`
color: #fff;
font-weight: 300;

`
const Wrapper = styled.section`
      padding: 1em;
      width:10%;
      display: flex; `;

const Movie =({ movies ,title, overview, date})=>{

    return (
        <Wrapper>
            <Title>{title}</Title>
            <Date>{date}</Date>
            <Description>{overview}</Description>
        </Wrapper>


    )

}

export default Movie
